import React, { useState } from "react";
import "./App.css";
import door from "./images/Realistic - door.png";
import electrical from "./images/Realistic - electrical.png";
import lover from "./images/lover.png";
import hello from "./images/hello world.png";
import dior from "./images/dior.png";
import diptyque from "./images/diptyque.png";
import dressroom from "./images/dressroom.png";
import pink from "./images/pink.png";
import disney from "./images/SAM_1029.JPG";
import blueflowers from "./images/SAM_1075.JPG";
import ocean from "./images/SAM_1105.JPG";
import getty from "./images/SAM_1088.JPG";
import garden from "./images/SAM_1055.JPG";
import palmtrees from "./images/SAM_1108.JPG";
import ducks from "./images/SAM_1057.JPG";
import tree from "./images/SAM_1054.JPG";
import logo from "./images/logo.png";

import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Link from "@mui/material/Link";
import Button from "@mui/material/Button";
import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import ImageListItemBar from "@mui/material/ImageListItemBar";
import IconButton from "@mui/material/IconButton";
import InfoIcon from "@mui/icons-material/Info";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import Menu from "@mui/material/Menu";
import Avatar from "@mui/material/Avatar";
import Tooltip from "@mui/material/Tooltip";
import MenuItem from "@mui/material/MenuItem";
import { ThemeProvider, createTheme, Typography } from "@mui/material";

import FlashcardList from "./FlashcardList";
import Contacts from "./components/Contacts";
import Digicam from "./components/Digicam";
import Education from "./components/Education";

const flashcard_component = [
  {
    id: 1,
    project_name: "Website development",
    details: "word",
  },
  {
    id: 2,
    project_name: "Data Visualization Project",
    details: "word2",
  },
  {
    id: 3,
    project_name: "Data Visualization Hackathon",
    details: "word3",
  },
];

const pages = ["Experience", "Project", "Hobby", "Contact"];
const myphotos = [
  {
    img: disney,
    title: "",
    author: "Where dreams come true",
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: blueflowers,
    title: "",
    author: "Flowers",
  },
  {
    img: ocean,
    title: "",
    author: "Beach",
  },
  {
    img: getty,
    title: "",
    author: "Getty",
    cols: 2,
  },
  {
    img: garden,
    title: "",
    author: "Bird near water",
    cols: 2,
  },
  {
    img: palmtrees,
    title: "",
    author: "Shape of leaves",
    rows: 2,
    cols: 2,
    featured: true,
  },
  {
    img: ducks,
    title: "",
    author: "Two ducks on the ledge",
  },
  {
    img: tree,
    title: "",
    author: "Mix of nature and architecture",
  },
];

const itemData = [
  {
    img: door,
    title: "door",
    author: "Sunlit day at 227",
  },
  {
    img: electrical,
    title: "electrical",
    author: "You left the power on",
  },
  {
    img: lover,
    title: "lover",
    author: "Lovers are stronger than haters",
  },
  {
    img: hello,
    title: "hello world",
    author: "My coding habits are coming out in 3D",
  },
  {
    img: dior,
    title: "dior",
    author: "The perfume on my mom's vanity",
  },
  {
    img: diptyque,
    title: "diptyque",
    author: "Untitled",
  },
  {
    img: dressroom,
    title: "dressroom",
    author: "Plastic perfume bottle",
  },
  {
    img: pink,
    title: "pink",
    author: "Shadows in pink",
  },
];

function App() {
  const [flashcards, setFlashcards] = useState(flashcard_component);
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };
  let photos = "Photos on Digital Camera";
  let [like, likechange] = useState(0);
  const theme = createTheme({
    typography: {
      h1: {
        fontFamily: "myFirstFont",
      },
      h2: {
        fontFamily: "myFirstFont",
      },
      p: {
        fontFamily: "louis",
      },
    },
  });
  return (
    <ThemeProvider theme={theme}>
      <Box
        sx={{
          color: "black",
          background:
            "linear-gradient(to right, #b4c0cf, #e8bdbe, #f4d2b5, #d4d5c8)",
        }}
      >
        <Stack className="App">
          <AppBar position="static">
            <Box
              sx={{
                background: "#eadbce",
                display: { xs: "none", md: "flex" },
                justifyContent: "flex",
              }}
            >
              <Toolbar>
                <Link href="/">
                  <Box
                    component="img"
                    sx={{ height: 75, justifyContent: "flex-start" }}
                    alt="Logo"
                    src={logo}
                  />
                </Link>
              </Toolbar>

              {pages.map((page) => (
                <Button
                  key={page}
                  onClick={handleCloseNavMenu}
                  sx={{ my: 2, color: "black", display: "block" }}
                >
                  {page}
                </Button>
              ))}
            </Box>
          </AppBar>

          <div className="list">
            <br />
            <br />
            <Typography variant="h1"> Alice Lee </Typography>
            <br />
            <br />
            <br />
          </div>

          <FlashcardList flashcards={flashcards} />

          <Education />

          <Digicam/>

          <Box
            ml={18}
            sx={{
              bgcolor: "#b5b5b5",
              borderRadius: 2,
              width: 1390,
              height: 250,
            }}
          >
            <div class="container">
              <div class="circle1"></div>
              <div class="circle2"></div>
              <div class="circle3"></div>
            </div>

              <Paper
                elevation={5}
                sx={{
                  bgcolor: "white",
                  borderRadius: 1,
                  width: 1390,
                  height: 845,
                  fontSize: 24,
                }}
              >
                <br />
                <Typography variant="h2">
                  {" "}
                  My Creations{" "}
                  <span
                    onClick={() => {
                      likechange(like + 1);
                    }}
                  >
                    {" "}
                    ❤️{" "}
                  </span>{" "}
                  {like}{" "}
                </Typography>
                <ImageList variant="masonry" cols={4} gap={7}>
                  {itemData.map((item) => (
                    <ImageListItem
                      sx={{ width: 300, height: 450, mr: "15px", ml: "15px" }}
                      key={item.img}
                    >
                      <img
                        src={`${item.img}?w=248&fit=crop&auto=format`}
                        srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
                        alt={item.title}
                        loading="lazy"
                      />
                      <ImageListItemBar position="below" title={item.author} />
                    </ImageListItem>
                  ))}
                </ImageList>
              </Paper>
              <Contacts />
          </Box>
        </Stack>
      </Box>
    </ThemeProvider>
  );
}

export default App;
